pragma solidity ^0.8.10;

// importing AggregatorV3Interface contract instead copying the entier contract it's self
import {AggregatorV3Interface} from "@chainlink/contracts/src/v0.8/shared/interfaces/AggregatorV3Interface.sol";

// With contract
// user can send funds
// owner can withdraw fund

contract CrowdFund {
    // ETH/USD price contract address
    address priceFeedAdress = 0x694AA1769357215DE4FAC081bf1f309aDC325306;
    int256 minAmount = 5;

    // function to fund ETH to the CrowdFund contract
    function fund() public payable {
    require(getConversionRate(int(msg.value)) > minAmount, "Minimum amount to send is 5");
    }

    //     // function to get version using chainlink's AggregatorV3Interface
    function getVersion() public view returns (uint256) {
        return AggregatorV3Interface(priceFeedAdress).version();
    }

    //     // function to get ETH price using chainlink's AggregatorV3Interface
    function getEthPrice() public view returns (int256) {
        AggregatorV3Interface priceFeed = AggregatorV3Interface(
            priceFeedAdress
        );
        (, int256 answer, , , ) = priceFeed.latestRoundData();
        // 2486.497063090000000000
        return (answer * 1e10) ;
    }

    function getConversionRate(int ethAmount) public view returns (int) {
      int currentEthValue = getEthPrice();
      int ethAmountInUSD = (ethAmount * currentEthValue)/1e18;
      return ethAmountInUSD;      
    }









